const map = L.map('map').setView([36.16, -86.78], 11);
L.tileLayer('https://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}{r}.png', {
    attribution: ' OpenStreetMap  CARTO'
}).addTo(map);

function getColor(elig) {
    if (elig.includes('USD')) return '#2ecc71';
    if (elig.includes('GSD')) return '#3498db';
    return '#9b59b6';
}

parcels.forEach(p => {
    const color = getColor(p.elig);
    const hasSecondary = p.elig.includes('Secondary');
    
    L.circleMarker([p.lat, p.lon], {
        radius: 5,
        fillColor: color,
        color: hasSecondary ? '#e74c3c' : color,
        weight: hasSecondary ? 2 : 1,
        fillOpacity: 0.7
    }).addTo(map).bindPopup(`
        <div class="info">
            <strong>${p.addr}</strong><br>
            APN: ${p.apn}<br>
            ${p.elig}<br>
            Lot: ${p.lot}<br>
            Max DADU: ${p.max_living} SF<br>
            Principal Height: ${Math.round(p.height)} ft
        </div>
    `);
});

const legend = L.control({position: 'bottomright'});
legend.onAdd = function() {
    const div = L.DomUtil.create('div', 'legend');
    div.innerHTML = `
        <h4>DADU Eligibility</h4>
        <div class="legend-item"><div class="legend-color" style="background:#2ecc71"></div>USD (By Right)</div>
        <div class="legend-item"><div class="legend-color" style="background:#3498db"></div>GSD (Overlay Required)</div>
        <div class="legend-item"><div class="legend-color" style="background:#e74c3c;border:2px solid #e74c3c"></div>Has Existing Secondary</div>
        <p style="font-size:11px;color:#666;margin-top:8px">Showing ${parcels.length.toLocaleString()} sample parcels</p>
    `;
    return div;
};
legend.addTo(map);
</script>
